import toCart from './../../img/products/ToCart.svg'

function Card(props) {
        console.log(props);
        

    

    return(
        <div className="card">
            
                <button className="img">
                    <img src={props.imageUrl} alt='products' />
                </button>
                        <p>{props.category}</p>
                        <a>{props.title}</a>
                        <b>{props.price} руб.</b>
            
                    <button className="add" onClick={props.onClick}>
                        {/* <img src={toCart} ></img> */}
                        <a>Добавить в корзину</a>
                    </button>
                
            </div>
    );
}

export default Card;
